import Link from "next/link";

const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Start Over</a>
    </Link>
    <Link href="/firstParent">
      <a style={linkStyle}>Get Started</a>
    </Link>
  </div>
);

export default Header;
